Уникальная коллекция книг разных жанров в одном приложении!

В нем вас ждут:

 • Несколько тысяч российских и зарубежных книг на любой вкус;
 • Все новинки и хиты;
 • Все писатели и издательства;
 • Широкий спектр жанров, от беллетристики до классики;
 • Удобная навигация и эргономичный плеер;
 • Качественная озвучка от профессиональных актеров;
 • Регулярные пополнения встроенной библиотеки;

Наше приложение откроет вам доступ к тысячам книг от российских и зарубежных издательств. С ним даже самый занятой
человек сможет найти время, чтобы получить удовольствие от классических произведений, заняться самообразованием или
ознакомиться со свежим бестселлером.

Дома, в автомобиле, в транспорте, в спортзале – где бы ни находились, вы всегда сможете провести время с пользой, слушая свои любимые книги.

Установите приложение и оцените, насколько комфортно можно слушать любимые книги!

***

Для полного доступа ко всем книгам вам необходимо активировать подписку в приложении. Подписка бесплатна первые семь дней!
Активная подписка продлится автоматически в конце оплаченного периода за 24 часа до окончания срока ее действия.
Если вы не хотите продлевать вашу подписку, ее можно отключить за 24 часа до окончания пробного или оплачиваемого периода.
Автоматическое продление подписки можно отключить самостоятельно в настройках вашего Apple ID. Текущая активная подписка не может быть отменена.

Политика конфиденциальности: https://nitapps.ru/m016/privacy-policy/
Условия использования: https://nitapps.ru/m016/terms-of-service/

AcuStorm - приложение для профессионалов, студентов и любителей акупунктуры, рассчитанное на оперативное использование в процессе лечения. В настоящее время приложение поддерживает стили акупунктуры: традиционный, 5 Первоэлементов, меридианный, метод Баланса д-ра Тана, акупунктура мастера Тонга.

Все функции и контент разделены на 4 взаимосвязанные вкладки со следующими свойствами.

Атлас:
- 3-слойные цветные рисунки;
- однооконный, многооконный и полноэкранные режимы;
- масштабирование и прокрутка рисунков;
- выбор рисунков и псевдо-3D навигация с историей;
- отображение точек и меридианов в соответствии с установленными фильтрами;
- отображение комбинаций точек в многооконном режиме;
- отображение точек в буфере обмена (иллюстрирование любых внешних текстов);
- всплывающие окна с краткой информацией о точке;
- динамические проекции (соответствия): укажите больную область с помощью активного курсора и увидите соответствующие терапевтические области.

Объекты:
- описание меридианных и внемеридианных точек по книге «Акупунктура: полный учебник» Шанхайской школы Традиционной медицины, перевод на английский и редактура Джон О'Коннор и Дэн Бенски, Eastland Press, 1981;
- информация о меридианах скомпилирована из ведущих западных источников;
- цепи каналов, составленные на основе 5 типов связи между меридианами; описания содержат показания, функции, иллюстрации и применение цепей в терапии; 
- системы терапевтического соответствия между частями тела;
- локализация точек уточнена по нескольким надежным учебникам и атласам;
- информация о точках Мастера Тонга скомпилирована из ведущих западных источников;
- именованные комбинации точек, в частности, составные точки, эффективные комбинации и 12 магических точек д-ра Тана;
- линейные списки точек с быстрыми закладками;
- поиск и фильтрация меридианов и точек;
- листание и гиперссылки с историей;
- разделение информации на разделы с переключаемой видимостью с сохранением состояния при навигации;
- локальные масштабируемые рисунки;
- закладки Избранное, пользовательские заметки.

Терапия:
- функции, показания и комбинации точек, скомпилированные из множества источников;
- раздел «Терапия» из книги «Акупунктура: Полный учебник»;
- области тела с проходящими меридианами, балансирующими меридианами по д-ру Тану, соответствующие проекции, специфические точки для данных областей;
- поиск и фильтрация функций, показаний, комбинаций, состояний;
- линейные списки точек с быстрыми закладками;
- листание и гиперссылки с историей;
- отображение комбинаций точек в многооконном режиме;
- разделение информации на разделы с переключаемой видимостью с сохранением состояния при навигации;
- пользовательские заметки с возможностью отображения точек в атласе;
- закладки Избранное.

Общее:
- стили акупунктуры в AcuStorm;
- категории точек;
- локализация точек;
- библиография.

Кроме того:
- Баланс-ассистент - динамическая матрица, помогающая выбирать балансирующие меридианы;
- Багуа-ассистент - помогает выбрать целевые гексаграммы и точки конвертации;
- полезные ссылки на Интернет-ресурсы, содержащие видео, графическую и текстовую информацию. Ссылки размещаются в соответствующем контексте.
- короткая справка в каждом разделе.

Настройки:
- выбор алфавитно-цифрового обозначения меридианов и точек (ВОЗ, английское, французское, и т.д.);
- опциональное отображение имен точек и меридианов в контенте;
- выбор локализации точек в случае определения по-разному разными источниками;
- настройка числа окон многооконного режима.

Магазин:
- разделение функций и контента на модули, приобретаемые независимо;
- пробный период 1 неделя для любого модуля;
- покупка модулей с помощью монет на внутреннем пополняемом балансе;
- пополнение баланса через покупки AppStore;
- получение бонусных монет на Ваш балансе при наличии купона или при активной помощи в продвижении приложения.
